import "./App.css";
import Dashboard from "./components/dashboard/Dashboard";
import { BrowserRouter } from "react-router-dom";
import Counter from "./components/counter/Counter";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Dashboard></Dashboard>
        <Counter />
      </BrowserRouter>
    </div>
  );
}

export default App;
